export default function Reducer(state = initialState, action) {
  switch (action.type) {
    case "ADDTOBASKET":
      let i = state.basket.filter((item) => item.id == action.value.id);
      if (i.length) {
        let newState = { ...state };
        console.log(newState.basket.filter((item) => item.id == i.id));
        return newState;
      } else {
        return { ...state, basket: [...state.basket, action.value] };
      }
    case "INCREASEITEM": {
      let id = action.value;
      let items = state.basket.map((i) => {
        if (id == i.id) {
          i.quantity = i.quantity + 1;
        }
        return i;
      });
      return { ...state, basket: items };
    }
    case "DECREASEITEM": {
      let id = action.value;
      let items = state.basket.map((i) => {
        if (id == i.id && i.quantity > 1) {
          i.quantity = i.quantity - 1;
        }
        return i;
      });
      return { ...state, basket: items };
    }
    case "REMOVEBASKET": {
      let id = action.value;
      let items = state.basket.filter((i) => id != i.id);
      return { ...state, basket: items };
    }
    case "SETFILTER": {
      return { ...state, filter: action.value };
    }
    case "BUY_NOW":
      return { ...state, buy: action.value };
  }
  return state;
}
